import * as ActionTypes from "./ActionTypes"

const initState = {
    loggedinUser: {
        email: "",
        displayName: "",
        pictureURL: ""
    },
    loggedinStatus: false
};


const userReducer=(state = initState,action)=>{
    switch(action.type){
        case ActionTypes.SIGNIN_USER:
            
            return{
                ...state,
                loggedinUser: action.payLoad
            }
        case ActionTypes.SIGNIN_USER:
                return{
                    ...state,
                    loggedinStatus: false
                }
        default: return state
    }
}

export default userReducer;
